// ButtonContainer.js
import React from 'react';
import './page2emr.css';

const buttonNames = [
    'Seizure',
    'Heart Attack',
    'Stroke',
    'Choke',
    'Sugar',
    'Blood',
    'Asthma',
    'Broken Stuff',
];
function ButtonContainer() {
    const buttons = buttonNames.map((name, index) => (
        <button key={index} className="button">
            {name}
        </button>
    ));

    return (
        <div className="button-container">
            {buttons}
            <button className="button emergency-button" style>Call 911</button>
        </div>
    );
}
export default ButtonContainer;
